  vec4 o = vec4(1, 1, 1, 1);
  #if USE_TEXTURE
    o *= CCSampleWithAlphaSeparated(cc_spriteTexture, uv0);
  #endif
  vec2 r = resolution;
  vec2 fragCoord = uv0 * r;
  vec2 iMouse = vec2(0.5);
  vec2 uv = fragCoord.xy / r.xy - 0.5;
  uv.y *= r.y / r.x;
  vec3 dir = vec3(uv * 0.800, 1.0);
  float time = cc_time.x * 0.010 + 0.25;
  float a1 = 0.5 + iMouse.x / r.x * 2.0;
  float a2 = 0.8 + iMouse.y / r.y * 2.0;
  mat2 rot1 = mat2(cos(a1), sin(a1), - sin(a1), cos(a1));
  mat2 rot2 = mat2(cos(a2), sin(a2), - sin(a2), cos(a2));
  dir.xz *= rot1;
  dir.xy *= rot2;
  vec3 from = vec3(1.0, 0.5, 0.5);
  from += vec3(time * 2.0, time, - 2.0);
  from.xz *= rot1;
  from.xy *= rot2;
  float s = 0.1, fade = 1.0;
  vec3 v = vec3(0.0);
  for(int r = 0; r < 20; r ++ ) {
    vec3 p = from + s * dir * 0.5;
    p = abs(vec3(0.850) - mod(p, vec3(0.850 * 2.0)));
    float pa, a = pa = 0.0;
    for(int i = 0; i < 17; i ++ ) {
      p = abs(p) / dot(p, p) - 0.53;
      a += abs(length(p) - pa);
      pa = length(p);
    }
    float dm = max(0.0, 0.300 - a * a * 0.001);
    a *= a * a;
    if (r > 6)fade *= 1.0 - dm;
    v += fade;
    v += vec3(s, s * s, s * s*s * s) * a * 0.0015 * fade;
    fade *= 0.730;
    s += 0.1;
  }
  v = mix(vec3(length(v)), v, 0.850);
  o = vec4(v * 0.01, 1.0);
  return o;
}
